import React from 'react'

const Cap = () => {

  const array = []
  for(let i=1;i<91;i++){
    array.push(i)
  }
  const capArr = array.map((e)=>{
    return require(`../../img/패션img/모자/모자${e}.jpg`)
  })

  return (
    <div style={{
      display:'flex',
      height:'100%'
    }}>
      {capArr.map((e, index)=>
        (<img key={index} src={e} style={{
          height:'100%',
          margin: '0 0 0 0',
          border: '1px solid black',
          borderRadius: '20%',
          boxSizing: 'border-box'
        }}/>)
      )}
    </div>
  )
}

export default Cap
